    axios.get(`${config.serverURL}/api/contests`)
    .then(resp => {
        return {
            initialMarkup: ReactDOMServer.renderToString( 
                <App initialContests = {resp.data.contests}/>
            ),
            initialData: resp.data
        };  
    });

export default serverRender;

